    "summary": "\u003ch4 style=\"color: #f96753;\"\u003eI\u0027M ALMOST 40! IT\u0027S ABOUT TIME I BECAME A FAMOUS RAPPER!\u003c/h4\u003e\nWelcome to the Nicky Nines Music \u0026amp; Video Patreon page.\n\u003cbr\u003e\nIn cause you haven\u2019t guessed, I\u2019m Nicky Eights\u2026\n\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003e\n*crickets*\u003c/strong\u003e\n\u003cbr\u003e\u003cbr\u003e\nJust kidding, I\u2019m Nicky Nines\u2026\n\u003cbr\u003e\u003cbr\u003e\nAnyway, I\u2019m here asking for your support to help me get enough money to buy bottle of Jameson each week because I\u2019m tried of spending my own cash\u2026\n\u003cbr\u003e\u003cbr\u003e\u003cstrong\u003e\n*crickets*\n\u003cbr\u003e\u003c/strong\u003e\u003cbr\u003e\nJust kidding...\u003cbr\u003e\u003cbr\u003e\nI\u2019m actually here, because in my spare time I put together, what I like to call, mosh rap records.\n\u003cbr\u003e\nIt\u2019s kind of a blend of everything I love about music, the aggressiveness or Dubstep and Drum and bass, they story telling of Bob Dylan, the Bass of Trap and current Hip Hop and the angry delivery of musicians like nines Inch Nails, Rage Against the Machine, and Onyx.\n\u003cbr\u003e\u003cbr\u003e\nSo, what do I need your scratch for?\u003cbr\u003e\u003cbr\u003eThe music industry has evolved greatly in the past few years.\n\u003cbr\u003e\u003cbr\u003eDon\u0027t get me wrong, it\u2019s still a grubby money making and money taking machine, but it\u2019s flooded with new-comers and terrible cookie cutter artist and nearly impossible for someone to make it based on having just talent.\u003cbr\u003e\u003cbr\u003e\nI\u2019m trying to get away from that.\u003cbr\u003e\u003cbr\u003eProblem is, I find that I spend more time on twitter and Facebook trying to get people to \u003cem\u003elisten\u003c/em\u003e to my music then I do actually creating it!\n\u003cbr\u003e\u003cbr\u003e\nUsing Patreon and your, much appreciated support, I\u2019d like to put content together a little more regularly and dial back - or even acquire help with helping market my stuff to a bigger audience in hopes of finding the listeners that appreciate the kind of music I\u2019m making.\n\u003cbr\u003e\nBy signing up right this minute, you\u2019ll get access to a bunch of songs and videos.\n\u003cbr\u003e\n\u003ch4 style=\"color: #f96753;\"\u003e\u003c/h4\u003e"

     "about": "\u003cstrong\u003eBecause Hiphop \u0026amp; Rap has gone Stale.\u00a0Nicky Nines and Mosh Rap was born.\u003c/strong\u003e\u003cbr\u003e\n\u003cbr\u003eBy staying away from that sound that\u2019s become common place - over simplified unmemorable beats consisting of stale 808\u2019s, stale snares and stale lyrics - and aspiring to put out music that has substance, content, and context, with ambitions to shoot videos that are more than just a rented foreign car with a gang of goons mobbing beside it, Nicky Nines creates himself a sound and style that you\u2019ve never heard before.\u003cbr\u003e\u003cbr\u003e\n\nAnd it feels right.\u003cbr\u003e\u003cbr\u003e\nMixing Rap, EDM, Hip-Hop, Metal and Rock with writing that has substance, context and themes but don\u2019t come off as \u201cconscious rap\u201d and is so much more than punchlines and witty quips, with a HEAVY and AGGRESSIVE style that one can only refer to as Electronic Mosh Rap.\u003cbr\u003e",
